import React, {useEffect} from 'react';
import './App.css';

function App() {

  useEffect(() => {
    fetch('file.json').then((res) => console.log(res.json())).then((data) => console.log(data))
  })

  return(
    <div>
      <h1>Hello React!</h1>
    </div>
  )
}



export default App;
